member.example:
How to enumerate properties using EntityField attribute:

[C#]
var project = new Project("sample.mpp");
foreach (var task in project.SelectAllChildTasks())
{
    Console.WriteLine("Task:");
    foreach (var propInfo in typeof(Task).GetProperties().Where(propInfo => propInfo.GetCustomAttribute{Attributes.EntityFieldAttribute}() != null))
    {
        Console.WriteLine(string.Format("{0}: {1}", propInfo.Name, propInfo.GetValue(task)));
    }
}

How to create simple calendar from scratch.

[C#]
// create empty calendar
Calendar calendar = new Calendar("New calendar");
// adds default working days (8 working hours from 9:00 to 17:00)
calendar.Days.Add(WeekDay.CreateDefaultWorkingDay(DayType.Monday));
calendar.Days.Add(WeekDay.CreateDefaultWorkingDay(DayType.Tuesday));
calendar.Days.Add(WeekDay.CreateDefaultWorkingDay(DayType.Wednesday));
// create new new working day
WeekDay myWeekDay = new WeekDay(DayType.Thursday);
// Sets working time. Only time part of DateTime is important
    WorkingTime wt1 = new WorkingTime();
    wt1.FromTime = new DateTime(1, 1, 1, 6, 0, 0, 0);
    wt1.ToTime = new DateTime(1, 1, 1, 12, 0, 0, 0);
    WorkingTime wt2 = new WorkingTime();
    wt2.FromTime = new DateTime(1, 1, 1, 14, 0, 0, 0);
    wt2.ToTime = new DateTime(1, 1, 1, 18, 0, 0, 0);
    myWeekDay.WorkingTimes.Add(wt1);
    myWeekDay.WorkingTimes.Add(wt2);
    myWeekDay.DayWorking = true;
calendar.Days.Add(myWeekDay);
calendar.Days.Add(WeekDay.CreateDefaultWorkingDay(DayType.Friday));
// adds weekend
calendar.Days.Add(new WeekDay(DayType.Saturday));
calendar.Days.Add(new WeekDay(DayType.Sunday));

[VB]
' create empty calendar
Dim calendar As Calendar =  New Calendar("New calendar")
' adds default working days (8 working hours from 9:00 to 17:00)
calendar.Days.Add(WeekDay.CreateDefaultWorkingDay(DayType.Monday))
calendar.Days.Add(WeekDay.CreateDefaultWorkingDay(DayType.Tuesday))
calendar.Days.Add(WeekDay.CreateDefaultWorkingDay(DayType.Wednesday))
' create new new working day
Dim myWeekDay As WeekDay =  New WeekDay(DayType.Thursday)
' Sets working time. Only time part of DateTime is important
    Dim wt1 As WorkingTime =  New WorkingTime()
    wt1.FromTime = New DateTime(1, 1, 1, 6, 0, 0, 0)
    wt1.ToTime = New DateTime(1, 1, 1, 12, 0, 0, 0)
    Dim wt2 As WorkingTime =  New WorkingTime()
    wt2.FromTime = New DateTime(1, 1, 1, 14, 0, 0, 0)
    wt2.ToTime = New DateTime(1, 1, 1, 18, 0, 0, 0)
    myWeekDay.WorkingTimes.Add(wt1)
    myWeekDay.WorkingTimes.Add(wt2)
    myWeekDay.DayWorking = True
calendar.Days.Add(myWeekDay)
calendar.Days.Add(WeekDay.CreateDefaultWorkingDay(DayType.Friday))
' adds weekend
calendar.Days.Add(New WeekDay(DayType.Saturday))
calendar.Days.Add(New WeekDay(DayType.Sunday))

 In this example instance of HtmlSaveOptions and the number of pages in resulting HTML is written to the console.
 
 [C#]
 Project project = new Project(@"test.mpp");
 HtmlSaveOptions saveOptions = new HtmlSaveOptions
 {
     IncludeProjectNameInPageHeader = false,
     IncludeProjectNameInTitle = false,
     PageSize = PageSize.A4,
     Timescale = Timescale.Days,
     StartDate = project.Get(Prj.StartDate).Date,
     EndDate = project.Get(Prj.FinishDate).Date
 };

 Console.WriteLine(project.GetPageCount(saveOptions));

member.remarks:

The Task is representing a one atomic chunk of work.
             One can use Task to plan a project by creating tasks and assign appropriate resources onto them.
             Tasks in a project are organized as a rooted hierarchical tree structure, with a root task and subtrees of children tasks. 

To build a tree of tasks one can use a specialized collection  by accessing  property e.g.:
             Project project = new Project();
            
             // add new tasks
             Task task1 = project.RootTask.Children.Add(); // a parent task with empty name is added
             Task childTask1 = task1.Children.Add("Child 1");
             childTask1.Set(Tsk.Start, new DateTime(2020, 2, 12, 8, 0, 0))
             childTask1.Set(Tsk.Duration, project.GetDuration(8, TimeUnitType.Hour));
             childTask1.Set(Tsk.Finish, new DateTime(2020, 2, 12, 17, 0, 0));
             Task childTask3 = task1.Children.Add("Child 3");
             childTask3.Set(Tsk.Start, new DateTime(2020, 2, 13, 8, 0, 0))
             childTask3.Set(Tsk.Duration, project.GetDuration(8, TimeUnitType.Hour));
             childTask3.Set(Tsk.Finish, new DateTime(2020, 2, 13, 17, 0, 0));
             Task childTask2 = task1.Children.Add("Child 2", 2); // inserts a task before the childTask3
             childTask2.Set(Tsk.Start, new DateTime(2020, 2, 14, 8, 0, 0))
             childTask2.Set(Tsk.Duration, project.GetDuration(8, TimeUnitType.Hour));
             childTask2.Set(Tsk.Finish, new DateTime(2020, 2, 14, 17, 0, 0));
             
             // save project in the one of available formats
             project.Save("Filled project.xml", SaveFileFormat.MPP);

member.example:
This example shows how to create instance of ProjectServerManager to access on-premise instance of Project Server.

[C#]
string site = "http://project_server_instance.local/";
var windowsCredentials = new NetworkCredential("Administrator", "my_password", "DOMAIN");
var projectServerCredentials = new ProjectServerCredentials(site, windowsCredentials);
ProjectServerManager manager = new ProjectServerManager(projectServerCredentials);

This example shows how to create instance of ProjectServerManager to access account in Project Online service.

[C#]
var credentials = new ProjectServerCredentials("https://xxxxxx.sharepoint.com", "yyyyy@xxxxxxx.onmicrosoft.com", "password");
ProjectServerManager manager = new ProjectServerManager(projectServerCredentials);

example.code:
In this example the debug info for the specific project is retrieved. You can pass the resulting "debug.zip" to the support team for troubleshooting purposes.
[C#]
var credentials = new ProjectServerCredentials("https://xxxxxx.sharepoint.com", "yyyyy@xxxxxxx.onmicrosoft.com", "password");
// Guid of project you are trying to get.
var projectGuid = new Guid("e0294bfb-5657-45c8-9cc5-82169fb95d69");
ProjectServerManager manager = new ProjectServerManager(credentials);
using (var fileStream = File.OpenWrite(@"c:\debug.zip"))
{
    using (var stream = manager.GetProjectRawData(projectGuid))
    {
        stream.CopyTo(fileStream);
    }
}

member.example:
In this example the project is loaded from Project Online account, modified and saved back to Project Online account.

[C#]
var credentials = new ProjectServerCredentials("https://xxxxxx.sharepoint.com", "yyyyy@xxxxxxx.onmicrosoft.com", "password");
ProjectServerManager manager = new ProjectServerManager(credentials);
var projectList = manager.GetProjectList();
var projectGuid = projectList.First().Id;
var project = manager.GetProject(projectGuid);
var task = project.RootTask.Children.Add("New task");
manager.UpdateProject(project);

In this example the project is loaded from Project Online account, modified and saved back to Project Online account.

[C#]
var credentials = new ProjectServerCredentials("https://xxxxxx.sharepoint.com", "yyyyy@xxxxxxx.onmicrosoft.com", "password");
ProjectServerManager manager = new ProjectServerManager(credentials);
var projectList = manager.GetProjectList();
var projectGuid = projectList.First().Id;
var project = manager.GetProject(projectGuid);
var task = project.RootTask.Children.Add("New task");
manager.UpdateProject(project, new ProjectServerSaveOptions
{
    ProjectGuid = projectGuid
});

